-- 创建教室表
CREATE TABLE classroom (
roomId VARCHAR(50) ,
campus VARCHAR(20),
room_type VARCHAR(30),
max_capacity INT
);

CREATE TABLE courses (
 course_id VARCHAR(50) ,
 course_type VARCHAR(20),
 campus VARCHAR(30),
 room_type VARCHAR(30) ,
 department VARCHAR(30)
);

CREATE TABLE schedules (
   course_id VARCHAR(50) ,
   teacher VARCHAR(20) ,
   class VARCHAR(50) ,
   student_count INT,
   week_begin INT,
   week_end INT ,
   week_times INT,
   consecutive_sections INT
);



